import React, { useEffect, useRef, useState } from "react";
import "../styles/StoryCarousel.css";

/**
 * StoryCarousel
 * - autoplay every 3s
 * - pause on hover / touch
 * - top segmented progress bar (animated)
 * - click / tap indicators to jump to slide
 *
 * Replace slide.image paths with your own images (public folder paths used here).
 */
export default function StoryCarousel() {
  const slides = [
    {
      id: "s1",
      image: process.env.PUBLIC_URL + "/fixedprice.png",
      avatar: process.env.PUBLIC_URL + "/myspiny-badge.png",
      name: "Madhulika Singh",
      place: "Lucknow",
      caption:
        "Spinny helped us find a family car that's great for daily commutes and long trips",
    },
    {
      id: "s2",
      image: process.env.PUBLIC_URL + "/story2.jpg",
      avatar: process.env.PUBLIC_URL + "/myspiny-badge.png",
      name: "Ravi Kumar",
      place: "Delhi",
      caption: "Excellent process, car delivery was smooth and on time",
    },
    {
      id: "s3",
      image: process.env.PUBLIC_URL + "/story3.jpg",
      avatar: process.env.PUBLIC_URL + "/myspiny-badge.png",
      name: "Sneha Sharma",
      place: "Bengaluru",
      caption: "Good inspection, transparent pricing — highly recommended",
    },
  ];

  const AUTOPLAY_MS = 3000;
  const [index, setIndex] = useState(0);
  const playingRef = useRef(true);
  const timerRef = useRef(null);

  // autoplay effect
  useEffect(() => {
    startTimer();
    return stopTimer;
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [index]); // we want the timer to restart (so animation restarts) when index changes

  function startTimer() {
    stopTimer();
    if (!playingRef.current) return;
    timerRef.current = setTimeout(() => {
      setIndex((i) => (i + 1) % slides.length);
    }, AUTOPLAY_MS);
  }

  function stopTimer() {
    if (timerRef.current) {
      clearTimeout(timerRef.current);
      timerRef.current = null;
    }
  }

  function handleMouseEnter() {
    playingRef.current = false;
    stopTimer();
  }
  function handleMouseLeave() {
    playingRef.current = true;
    startTimer();
  }

  function handleTouchStart() {
    playingRef.current = false;
    stopTimer();
  }
  function handleTouchEnd() {
    playingRef.current = true;
    startTimer();
  }

  function goTo(i) {
    setIndex(i);
  }

  return (
    <section
      className="sc-root"
      aria-roledescription="carousel"
      aria-label="Customer stories"
    >
      {/* progress segments */}
      <div className="sc-progress">
        {slides.map((s, i) => (
          <div key={s.id} className="sc-progress-seg" aria-hidden>
            <div
              className={`sc-progress-fill ${i === index ? "active" : ""}`}
              style={{ animationDuration: `${AUTOPLAY_MS}ms` }}
            />
          </div>
        ))}
      </div>

      {/* the slide area */}
      <div
        className="sc-slide"
        onMouseEnter={handleMouseEnter}
        onMouseLeave={handleMouseLeave}
        onTouchStart={handleTouchStart}
        onTouchEnd={handleTouchEnd}
        role="group"
        aria-roledescription="slide"
        aria-label={`${index + 1} of ${slides.length}`}
        style={{
          backgroundImage: `url(${slides[index].image})`,
        }}
      >
        <div className="sc-overlay" />

        <div className="sc-top-left">
          <img src={slides[index].avatar} alt="" className="sc-badge" />
          <span className="sc-badge-text">myspinny</span>
        </div>

        <div className="sc-bottom">
          <div className="sc-meta">
            <div className="sc-meta-left">
              <div className="sc-meta-icon" />

              <div className="sc-name">
                <strong>{slides[index].name}</strong>
                <span className="sc-place"> | {slides[index].place}</span>
              </div>
            </div>
            <div className="sc-caption">{slides[index].caption}</div>
          </div>
        </div>
      </div>

      {/* small clickable dots */}
      <div className="sc-dots" role="tablist" aria-label="Slides">
        {slides.map((_, i) => (
          <button
            key={i}
            className={`sc-dot ${i === index ? "active" : ""}`}
            onClick={() => goTo(i)}
            aria-label={`Go to slide ${i + 1}`}
            aria-pressed={i === index}
          />
        ))}
      </div>
    </section>
  );
}
